#include "hmathCPU.h"
#include "hConstTypes.h"
#include "hMT_AtomicData_CPU.h"
#include "hPotential_CPU.h"

cMT_AtomicData_CPU::cMT_AtomicData_CPU(int PotPar_i)
{
	PotPar = 0;
	AtomicData = new sAtomicData[stNAE];
	fegPar = new sCoefPar[stNAE];
	for(int i=0; i<stNAE; i++)
	{
		fegPar[i].cl = new double[6];
		fegPar[i].cnl = new double[6];
	}
	Load_Data(PotPar_i);
}

cMT_AtomicData_CPU::~cMT_AtomicData_CPU()
{
	PotPar = 0;
	delete [] AtomicData; AtomicData = 0;
	for(int i=0; i<stNAE; i++)
	{
		delete [] fegPar[i].cl; fegPar[i].cl = 0;
		delete [] fegPar[i].cnl; fegPar[i].cnl = 0;
	}
	delete [] fegPar; fegPar = 0;
}

