// get Coefficients
void cMT_AtomicData_CPU::getCoef(int Z, sCoefPar &cfeg, sCoefPar &cfxg, sCoefPar &cPr, sCoefPar &cVr, sCoefPar &cVR)
{
	int i, iZ = Z-1;
	double cl, cnl;

	for(i=0; i<6; i++)
	{
		cfeg.cl[i] = cfeg.cnl[i] = 0.0;
		cfxg.cl[i] = cfxg.cnl[i] = 0.0;
		cPr.cl[i] = cPr.cnl[i] = 0.0;
		cVr.cl[i] = cVr.cnl[i] = 0.0;
		cVR.cl[i] = cVR.cnl[i] = 0.0;
	}

	if(PotPar<=3)
	{
		// 1: Doyle and Turner parameterization - 4 Gaussians - [0, 4]
		// 2: Peng et al. parameterization - 5 Gaussians - [0, 4]
		// 3: Peng et al. parameterization - 5 Gaussians - [0, 12]
		for(i=0; i<6; i++)
		{
			cfeg.cl[i] = fegPar[iZ].cl[i];
			cfeg.cnl[i] = fegPar[iZ].cnl[i]/4.0;
			if(cfeg.cnl[i]==0)
			{
				cfeg.cl[i] = 0;
			}
		}
		for(i=0; i<6; i++)
			if((cfeg.cl[i]!=0)&&(cfeg.cnl[i]!=0))
			{
				cl = cfeg.cl[i]; cnl = cfeg.cnl[i];

				cfxg.cl[i] = c2Pi2a0*cl;
				cfxg.cnl[i] = cnl;

				cPr.cl[i] = 0.5*c2Pi2a0*cl*pow(cPi/cnl, 3.5);
				cPr.cnl[i] = cPi2/cnl;

				cVr.cl[i] = cPotf*cl*pow(cPi/cnl, 1.5);
				cVr.cnl[i] = cPi2/cnl;

				cVR.cl[i] = cPotf*cPi*cl/cnl;
				cVR.cnl[i] = cPi2/cnl;
			}
	}
	else if(PotPar==4)
	{
		// 4: Kirkland parameterization - 3 Yukawa + 3 Gaussians - [0, 12]
		for(i=0; i<6; i++)
		{
			cfeg.cl[i] = fegPar[iZ].cl[i];
			cfeg.cnl[i] = fegPar[iZ].cnl[i];
			if(cfeg.cnl[i]==0)
			{
				cfeg.cl[i] = 0;
			}
		}
		for(i=0; i<3; i++)
			if((cfeg.cl[i]!=0)&&(cfeg.cnl[i]!=0))
			{
				cl = cfeg.cl[i]; cnl = cfeg.cnl[i];

				cfxg.cl[i] = c2Pi2a0*cl;
				cfxg.cnl[i] = cnl;

				cPr.cl[i] = c2Pi2a0*cPi*cl*cnl;
				cPr.cnl[i] = c2Pi*sqrt(cnl);

				cVr.cl[i] = cPotf*cPi*cl;
				cVr.cnl[i] = c2Pi*sqrt(cnl);

				cVR.cl[i] = cPotf*c2Pi*cl;
				cVR.cnl[i] = c2Pi*sqrt(cnl);
			}
		for(i=3; i<6; i++)
			if((cfeg.cl[i]!=0)&&(cfeg.cnl[i]!=0))
			{
				cl = cfeg.cl[i]; cnl = cfeg.cnl[i];

				cfxg.cl[i] = c2Pi2a0*cl;
				cfxg.cnl[i] = cnl;

				cPr.cl[i] = 0.5*c2Pi2a0*cl*pow(cPi/cnl, 3.5);
				cPr.cnl[i] = cPi2/cnl;

				cVr.cl[i] = cPotf*cl*pow(cPi/cnl, 1.5);
				cVr.cnl[i] = cPi2/cnl;

				cVR.cl[i] = cPotf*cPi*cl/cnl;
				cVR.cnl[i] = cPi2/cnl;
			}
	}
	else if(PotPar==5)
	{
		// 5: Weickenmeier and H.Kohl - a*(1-exp(-bg^2)/g^2 - [0, 12]
		for(i=0; i<6; i++)
		{
			cfeg.cl[i] = 4.0*0.0239336609991378*Z/(3.0*(1.0+fegPar[iZ].cl[i]));
			if(i>=3)
			{
				cfeg.cl[i] *= fegPar[iZ].cl[i];
			}
			cfeg.cnl[i] = fegPar[iZ].cnl[i]/4.0;
			if(cfeg.cnl[i]==0)
			{
				cfeg.cl[i] = 0;
			}
		}
		for(i=0; i<6; i++)
			if((cfeg.cl[i]!=0)&&(cfeg.cnl[i]!=0))
			{
				cl = cfeg.cl[i]; cnl = cfeg.cnl[i];

				cfxg.cl[i] = c2Pi2a0*cl;
				cfxg.cnl[i] = cnl;

				cPr.cl[i] = c2Pi2a0*cl*pow(cPi/cnl, 1.5);
				cPr.cnl[i] = cPi2/cnl;

				cVr.cl[i] = cPotf*cPi*cl;
				cVr.cnl[i] = cPi/sqrt(cnl);

				cVR.cl[i] = cPotf*0;
				cVR.cnl[i] = 0;
			}
	}
	else if(PotPar==6)
	{
			// 6: Lobato parameterization - Hydrogen functions - [0, 12]
		for(i=0; i<6; i++)
		{
			cfeg.cl[i] = fegPar[iZ].cl[i];
			cfeg.cnl[i] = fegPar[iZ].cnl[i];
			if(cfeg.cnl[i]==0)
			{
				cfeg.cl[i] = 0;
			}
		}
		for(i=0; i<5; i++)
			if((cfeg.cl[i]!=0)&&(cfeg.cnl[i]!=0))
			{
				cl = cfeg.cl[i]; cnl = cfeg.cnl[i];

				cfxg.cl[i] = c2Pi2a0*cl/cnl;
				cfxg.cnl[i] = cnl;

				cPr.cl[i] = c2Pi2a0*cPi2*cl/pow(cnl, 2.5);
				cPr.cnl[i] = c2Pi/sqrt(cnl);

				cVr.cl[i] = cPotf*cPi2*cl/pow(cnl, 1.5);
				cVr.cnl[i] = c2Pi/sqrt(cnl);

				cVR.cl[i] = 2.0*cPotf*cPi2*cl/pow(cnl, 1.5);
				cVR.cnl[i] = c2Pi/sqrt(cnl);
			}
	}
}

/***********************************************************************************************/
// Load atomic Parameterization
void cMT_AtomicData_CPU::Load_Data(int PotPar_i)
{
	// Load atomic data tables	
	Load_Atomic_Data(AtomicData);

	PotPar = PotPar_i;
	switch(PotPar)
	{
		case 1:
			Load_feg_Doyle_0_4(fegPar);
			break;
		case 2:
			Load_feg_Peng_0_4(fegPar);
			break;
		case 3:
			Load_feg_Peng_0_12(fegPar);
			break;
		case 4:
			Load_feg_Kirkland_0_12(fegPar);
			break;
		case 5:
			Load_feg_Weickenmeier_0_12(fegPar);
			break;
		case 6:
			Load_feg_Lobato_0_12(fegPar);
			break;
	}
}

// Load atomic data tables (Atomic dat. + Atomic par.)
void cMT_AtomicData_CPU::To_MT_AtomTypes_CPU(int Z_i, double Vrl_i, int nR_i, double Rmin_i, cMT_AtomTypes_CPU *MT_AtomTypes_CPU)
{
	int iZ = Z_i - 1;
	if(Vrl_i<=0)
	{
		Vrl_i = stVrl;
	}
	if(nR_i<=0)
	{
		nR_i = stnR;
	}

	MT_AtomTypes_CPU->Z = Z_i;
	MT_AtomTypes_CPU->A = AtomicData[iZ].A;
	MT_AtomTypes_CPU->m = AtomicData[iZ].m;
	MT_AtomTypes_CPU->rn_e = AtomicData[iZ].rn*1e-05;
	MT_AtomTypes_CPU->rn_c = (1.2e-05)*pow((double)(AtomicData[iZ].A), 1.0/3.0);
	MT_AtomTypes_CPU->ra_e = AtomicData[iZ].ra;
	MT_AtomTypes_CPU->ra_c = 0.0;
	MT_AtomTypes_CPU->Rmin = MAX(MT_AtomTypes_CPU->rn_c, Rmin_i);
	MT_AtomTypes_CPU->Rmin2 = pow(MT_AtomTypes_CPU->Rmin, 2);
	MT_AtomTypes_CPU->Rmax = 0;
	MT_AtomTypes_CPU->Rmax2 = 0;

	getCoef(Z_i, MT_AtomTypes_CPU->cfeg, MT_AtomTypes_CPU->cfxg, MT_AtomTypes_CPU->cPr, MT_AtomTypes_CPU->cVr, MT_AtomTypes_CPU->cVR);

	// ra_c and Rmax
	Potential_CPU.SetAtomTypes(PotPar, MT_AtomTypes_CPU);
	Potential_CPU.SetSigma(0.0);

	MT_AtomTypes_CPU->ra_c = 3.0*Potential_CPU.AtomicRadius_rms(3);
	MT_AtomTypes_CPU->Rmax = Potential_CPU.AtomicRadius_Cutoff(3, Vrl_i);

	if(MT_AtomTypes_CPU->ra_c == 0)
	{
		MT_AtomTypes_CPU->ra_c = 1.75*MT_AtomTypes_CPU->ra_e;
	}

	if(MT_AtomTypes_CPU->Rmax == 0)
	{
		MT_AtomTypes_CPU->Rmax = 1.75*MT_AtomTypes_CPU->ra_e;
	}

	MT_AtomTypes_CPU->Rmax2 = pow(MT_AtomTypes_CPU->Rmax, 2);

	// R and R2
	MT_AtomTypes_CPU->nR = nR_i;

	double dlnr = log(MT_AtomTypes_CPU->Rmax/MT_AtomTypes_CPU->Rmin)/double(MT_AtomTypes_CPU->nR-1);
	for(int iR=0; iR<MT_AtomTypes_CPU->nR; iR++)
	{
		MT_AtomTypes_CPU->R[iR] = MT_AtomTypes_CPU->Rmin*exp(iR*dlnr);
		MT_AtomTypes_CPU->R2[iR] = pow(MT_AtomTypes_CPU->R[iR], 2);
	}

	// Vr and dVr
	int IntType = 0, Dim = 2;
	double *VR = new double[MT_AtomTypes_CPU->nR];
	double *dVR = new double[MT_AtomTypes_CPU->nR];

	Potential_CPU.SetAtomTypes(PotPar, MT_AtomTypes_CPU);
	Potential_CPU.SetSigma(0.0);
	Potential_CPU.Vr(IntType, Dim, MT_AtomTypes_CPU->nR, MT_AtomTypes_CPU->R, VR, dVR);

	// ciVR.c0, ciVR.c1, ciVR.c2 and ciVR.c3
	double dR2, m, n;
	double V, Vn, dV, dVn;

	for(int iR=0; iR<MT_AtomTypes_CPU->nR; iR++)
	{
		MT_AtomTypes_CPU->ciVR.c0[iR] = VR[iR];
		MT_AtomTypes_CPU->ciVR.c1[iR] = 0.5*dVR[iR]/MT_AtomTypes_CPU->R[iR];
	}

	for(int iR=0; iR<MT_AtomTypes_CPU->nR-1; iR++)
	{
		dR2 = 1.0/(MT_AtomTypes_CPU->R2[iR+1]-MT_AtomTypes_CPU->R2[iR]);
		V = MT_AtomTypes_CPU->ciVR.c0[iR]; Vn = MT_AtomTypes_CPU->ciVR.c0[iR+1];
		dV = MT_AtomTypes_CPU->ciVR.c1[iR]; dVn = MT_AtomTypes_CPU->ciVR.c1[iR+1];
		m = (Vn-V)*dR2; n = dV+dVn;
		MT_AtomTypes_CPU->ciVR.c0[iR] = V-MT_AtomTypes_CPU->ciVR.c0[MT_AtomTypes_CPU->nR-1];
		MT_AtomTypes_CPU->ciVR.c2[iR] = (3.0*m-n-dV)*dR2;
		MT_AtomTypes_CPU->ciVR.c3[iR] = (n-2.0*m)*dR2*dR2;
	}

	delete [] VR; VR = 0;
	delete [] dVR; dVR = 0;
}
